import PBlock from "./PBlock";
import LbBlockO from "./LbBlockO";
import LbBlockY from "./LbBlockY";
import Contact from "./Contact";

function Cv(props) {
  return (
    <div>
      <PBlock values={props.valueList} />
      <LbBlockO values={props.valueList} />
      <LbBlockY values={props.valueList} />
      <Contact values={props.valueList} />
    </div>
  );
}
export default Cv;
